-- ----------------------------
-- Procedure structure for FilterTukerPoint
-- ----------------------------
DROP PROCEDURE IF EXISTS `FilterTukerPoint`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `FilterTukerPoint`(
in Nomemeber varchar(50)
)
BEGIN
IF EXISTS(SELECT 1 FROM TransactionMember WHERE Userid=Nomemeber limit 1) THEN
BEGIN
select ifnull(TotalPoint,0) as TotalPoint  from TransactionMember where UserId=Nomemeber 
order by transactiondate desc
limit 1;
END;
ELSE
BEGIN
    SELECT ifnull(sum(UserPoints),0) as UserPoints FROM members WHERE Userid=Nomemeber
limit 1;
END;
END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ReadMemberPos
-- ----------------------------
DROP PROCEDURE IF EXISTS `ReadMemberPos`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `ReadMemberPos`( in Nomemeber varchar(50)
)
BEGIN
IF EXISTS(SELECT 1 FROM TransactionMember WHERE Userid=Nomemeber limit 1) THEN
BEGIN
select UserFullName,ifnull(totalpoint,0) as totalpoint from TransactionMember a
left join members b on a.userid=b.userid
where a.userid=Nomemeber order by transactiondate desc
limit 1;
END;
ELSE
BEGIN
    SELECT UserFullName,ifnull(UserPoints,0) as UserPoints/*,TransactionId*/ FROM members WHERE Userid=Nomemeber and userActive=1
limit 1;
END;
END IF;
    END
;;
delimiter ;

