-- ----------------------------
-- Procedure structure for SaveUpdatePointPOS
-- ----------------------------
DROP PROCEDURE IF EXISTS `SaveUpdatePointPOS`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `SaveUpdatePointPOS`(
in Transno varchar(100),
in TotalPoint varchar(50),
in MembershipNo varchar(50),
in totaltransaction  varchar(100),
in outlet varchar(100),
in RewordPoint  varchar(50)
)
BEGIN
IF NOT EXISTS(SELECT 1 FROM TransactionMember where TransactionId=Transno limit 1)then
begin
if exists(SELECT 1 FROM members where Userid=MembershipNo limit 1)then
begin
       VALUES(MembershipNo,now(),TotalPoint,Transno,totaltransaction,outlet,RewordPoint);
end;
end if;
end;
end if;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for SaveUpdateTukarPoint
-- ----------------------------
DROP PROCEDURE IF EXISTS `SaveUpdateTukarPoint`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `SaveUpdateTukarPoint`(
in MembershipNo varchar(50),
in Points  varchar(50),
in Transno varchar(100),
in totaltransaction  varchar(100),
in outlet varchar(100),
in RewardPoint varchar(100),
in PointUsage  varchar(50),
in TotalPayment varchar(100)
)
BEGIN
VALUES(MembershipNo,now(),Points,Transno ,totaltransaction,outlet,RewardPoint,PointUsage,TotalPayment);
    END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for UpdatePoint
-- ----------------------------
DROP PROCEDURE IF EXISTS `UpdatePoint`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `UpdatePoint`(
in Transno varchar(100),
in Point  int,
in RewardPoint int
)
BEGIN
update TransactionMember set TotalPoint =(RewardPoint+Point) where  transactionid=Transno;
    END
;;
delimiter ;

